 @edimilsonalves1974  O único time a estar disputando três competições, então, primeiro ganhe uma para se vangloriar de alguma coisa. Se não ganhar nenhuma das três, isso vai fazer diferença?
O Renato Kayzer fez muitos gols importantes? Na onde? No Poderoso campeonato estadual kkkkkkkkk ninguém é otário, acompanhamos futebol e sabemos os jogos que ele fez.
Por último, realmente você tem razão, O Athletico Paranaense é um exemplo de gestão no Brasil e tem um dos estádios 🏟mais do bonito do Brasil junto com o Grêmio, porém continua sendo um time pequeno, ou você que isso te torna grande? Kkkkkkkk PSG é um dos milionários do mundo e mesmo assim é um nanico. Nem torcida vocês tem direito, falta títulos, falta história. Pelé, Zico, Ronaldo Fenômeno, Ronaldinho Gaúcho jogadores, todos maiores que a instituição Athletico Paranaense.
